    def "test 3 bedroom nights #month"() throws IOException {
        ArrayList<Integer> counts = checkerService.retrieveRoomNights(Checker.THREE_BEDROOM)
        expect:
        counts.get(index) == val
        where:
        month       | index | val
        "August"    | 0     | 23
        "September" | 1     | 7
        "October"   | 2     | 4
        "November"  | 3     | 0
        "December"  | 4     | 0
        "January"   | 5     | 0
        "February"  | 6     | 0
        "March"     | 7     | 0
    }

    def "test 2 bedroom nights"() throws IOException {
